import { BrowserRouter, Routes, Route } from "react-router-dom";
import Sign from "./components/sign_comp/js/sign.js";
import Err from "./components/err_comp/js/index.js";
function App() {
  function returnSign() {
    if (window.localStorage["username"] && window.localStorage["password"]) {
      return <Route path="/" element={<Sign />} />;
    } else {
      return <Route path="/" element={<Sign />} />;
    }
  }
  return (
    <>
      {
        <BrowserRouter>
          <Routes>
            {returnSign()}
            <Route path="*" element={<Err />} />
          </Routes>
        </BrowserRouter>
      }
    </>
  );
}

export default App;
